Lacey Banghard (born 30 December 1992) is a glamour model and Page 3 Girl from Bedford, England. She was the winner of The Sun newspaper's roughly-annual Page 3 Idol competition in 2011. [1][2] Lacey made her first glamour appearance in Nuts magazine of 31st December 2010 - 6th January 2011.
